import React from "react";
import Slider from "react-slick"
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";

const CatSlider =()=>{
    const items = [
        {
          id: 1,
          title: "Nothing Beats The CITY",
          image: "path-to-your-cat-image.jpg", // replace with actual image URL
          buttonText: "Shop Now",
        },
        {
          id: 2,
          title: "Nike Pegasus 41 PRM",
          image: "path-to-your-runner-image.jpg", // replace with actual image URL
          buttonText: "Shop Now",
        },
        {
          id: 3,
          title: "Mercurial Dream Speed",
          image: "path-to-your-shoes-image.jpg", // replace with actual image URL
          buttonText: "Shop Now",
        },
      ];

      const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1,
        responsive: [
          {
            breakpoint: 768, // Adjust for smaller devices
            settings: {
              slidesToShow: 1,
              slidesToScroll: 1,
            },
          },
        ],
      };
    
    return(
        <div className="catSliderSection">
            <div className="container-fluid">
                <h2 className="hd">featured</h2>
                <Slider {...settings} className="cat_slider_Main">

                </Slider>
            </div>
        </div>)
}
export default CatSlider;
